import React from 'react';
function ToDoItem(props) {
  let item = props.item;
  return (
    <div className="col-lg-7">
      <input id={item.name} type="radio" value="other" name="gender" className="pl-2" />
      <label for={item.name}>{item.name}</label>
    </div>
  )
}

export default ToDoItem
